window.bookSummaryJSON = "<p><b>Fear the reaper!</b></p> <p>Reincarnated into the fantasy&nbsp;world of Skyhaven, James inherits the Necromancer System, the game-like interface of the most villainous sorcerer to ever threaten the world.</p> <p>Granted fearsome and despicable abilities by the system, James must level up and embrace the power he's been given to usher in a new age of darkness and evil upon all of Skyhaven.&nbsp;</p> <p>First, he'll have to navigate the cutthroat politics of the noble house he's been reincarnated into, using all of the skills and abilities at his disposal.</p> <p>Even so, family isn't the only thing James has to fear. Necromancers stalk the streets of his home-city, spreading plague. If he fails, death is the very best he can hope for.&nbsp;</p> <p>If James wants to escape daggers in the dark and an early grave, he'll need to become a true Lord of Souls.</p> <p>Unleash your inner villain. Join James on his ascent to infamy and discover true evil by clicking \"buy now\" to begin an epic fantasy evil MC LitRPG adventure. A new era of villainy awaits!&nbsp;</p> <p><b>Warning: </b>This book contains graphic violence, gore, and elements of sexual abuse&nbsp;that some listeners may find deeply disturbing. This is not an anti-hero novel where the protagonist is \"actually the good guy\". If you like evil MCs, this is the novel for you.\"</p>"; 
